import { Form, redirect, useParams, useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
async function updateBook(id, updatedBook) {
  try {
    let response = await fetch(`/table/${id}`, {
      method: "PUT",
      body: JSON.stringify(updatedBook),
      headers: new Headers({
        "Content-Type": "application/json",
      }),
    }).then((res) => {
      if (!res.ok) {
        throw Error({ error: `Could not update book ${id}` });
      }
      return res.json();
    });
    return response;
  } catch (error) {
    console.error("Error:", error);
  }
}

export async function updateAction({ request, params }) {
  const formData = await request.formData();
  let book = Object.fromEntries(formData);
  if (!book) {
    throw new Error("Error in updating Book " + params.id);
  }
  const { id } = params;
  const updatedBook = { id, ...book };
  await updateBook(id, updatedBook);
  return redirect(`/admin/`);
}

export default function EditTable() {
  const { id } = useParams();
  const navigate = useNavigate();

  // Load initial product data from API
  const [book, setBook] = useState();
  useEffect(() => {
    async function fetchBook() {
      const response = await fetch(`/table/${id}`);
      const data = await response.json();
      setBook(data);
    }
    fetchBook();
  }, [id]);
  // Render loading state while waiting for product data to load
  if (!book) {
    return <div>Loading...</div>;
  }

  return (
    <Form replace method="put">
      <label>
        ID:
        <input type="text" defaultValue={book.id} name="id" />
      </label>
      <label>
        ชื่อหนังสือ:
        <input type="text" name="title" defaultValue={book.title} />
      </label>
      <label>
        ชื่อผู้แต่ง:
        <input type="text" defaultValue={book.author} name="author" />
      </label>
      <label>
        สำนักพิมพ์:
        <input type="text" defaultValue={book.publisher} name="publisher" />
      </label>
      <label>
        จำนวนหน้า:
        <input
          type="number"
          defaultValue={book.number_of_pages}
          name="number_of_pages"
        />
      </label>
      <label>
        ปีที่ตีพิมพ์:
        <input type="number" defaultValue={book.year} name="year" />
      </label>
      <label>
        หมวดหมู่:
        <input type="text" defaultValue={book.category} name="category" />
      </label>
      <label>
        ราคา:
        <input type="number" defaultValue={book.price} name="price" />
      </label>
      <label>
        รายละเอียด:
        <textarea defaultValue={book.detail} name="detail" />
      </label>
      <label>
        รูป:
        <input type="text" defaultValue={book.img} name="img" />
      </label>
      <div className="bt-submit">
        <button className="bt-s" type="submit">
          บันทึก
        </button>
        <button
          className="bt-cancel"
          type="button"
          onClick={() => {
            navigate(-1);
          }}
        >
          ยกเลิก
        </button>
      </div>
    </Form>
  );
}

